{
  "ubx_message": {
    "name": "UBX-NAV-SIG",
    "class_id": "0x01",
    "message_id": "0x43",
    "message_type": "periodic_polled",
    "description": "This message displays information about signals currently tracked by the receiver. On the F9 platform the maximum number of signals is 120.",
    "payload_length": {
      "variable": {
        "base": 8,
        "formula": "8 + numSigs * 16"
      }
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U4",
        "name": "iTOW",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch. See the section iTOW timestamps in Integration manual for details."
      },
      {
        "byte_offset": 4,
        "data_type": "U1",
        "name": "version",
        "fixed_value": 0,
        "description": "Message version (0x00 for this version)"
      },
      {
        "byte_offset": 5,
        "data_type": "U1",
        "name": "numSigs",
        "description": "Number of signals"
      },
      {
        "byte_offset": 6,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "name": "reserved0",
        "reserved": true
      },
      {
        "byte_offset": 8,
        "data_type": "repeated_group",
        "name": "signals",
        "count_field": "numSigs",
        "fields": [
          {
            "byte_offset": 0,
            "data_type": "U1",
            "name": "gnssId",
            "description": "GNSS identifier (see Satellite Numbering) for assignment"
          },
          {
            "byte_offset": 1,
            "data_type": "U1",
            "name": "svId",
            "description": "Satellite identifier (see Satellite Numbering) for assignment"
          },
          {
            "byte_offset": 2,
            "data_type": "U1",
            "name": "sigId",
            "description": "New style signal identifier (see Signal Identifiers)"
          },
          {
            "byte_offset": 3,
            "data_type": "U1",
            "name": "freqId",
            "description": "Only used for GLONASS: This is the frequency slot + 7 (range from 0 to 13)"
          },
          {
            "byte_offset": 4,
            "data_type": "I2",
            "name": "prRes",
            "scale": {
              "multiplier": 0.1,
              "raw": "0.1"
            },
            "unit": "m",
            "description": "Pseudorange residual"
          },
          {
            "byte_offset": 6,
            "data_type": "U1",
            "name": "cno",
            "unit": "dBHz",
            "description": "Carrier-to-noise density ratio (signal strength)"
          },
          {
            "byte_offset": 7,
            "data_type": "U1",
            "name": "qualityInd",
            "description": "Signal quality indicator: 0 = no signal, 1 = searching signal, 2 = signal acquired, 3 = signal detected but unusable, 4 = code locked and time synchronized, 5, 6, 7 = code and carrier locked and time synchronized"
          },
          {
            "byte_offset": 8,
            "data_type": "U1",
            "name": "corrSource",
            "description": "Correction source: 0 = no corrections, 1 = SBAS corrections, 2 = BeiDou corrections, 3 = RTCM2 corrections, 4 = RTCM3 OSR corrections, 5 = RTCM3 SSR corrections, 6 = QZSS SLAS corrections"
          },
          {
            "byte_offset": 9,
            "data_type": "U1",
            "name": "ionoModel",
            "description": "Ionospheric model used: 0 = no model, 1 = Klobuchar model transmitted by GPS, 2 = SBAS model, 3 = Klobuchar model transmitted by BeiDou, 8 = Iono delay derived from dual frequency observations"
          },
          {
            "byte_offset": 10,
            "data_type": "X2",
            "name": "sigFlags",
            "description": "Signal related flags",
            "bit_fields": [
              {
                "bit_offset": 0,
                "num_bits": 2,
                "name": "health",
                "description": "Signal health flag: 0 = unknown, 1 = healthy, 2 = unhealthy"
              },
              {
                "bit_offset": 2,
                "num_bits": 1,
                "name": "prSmoothed",
                "description": "1 = Pseudorange has been smoothed"
              },
              {
                "bit_offset": 3,
                "num_bits": 1,
                "name": "prUsed",
                "description": "1 = Pseudorange has been used for this signal"
              },
              {
                "bit_offset": 4,
                "num_bits": 1,
                "name": "crUsed",
                "description": "1 = Carrier range has been used for this signal"
              },
              {
                "bit_offset": 5,
                "num_bits": 1,
                "name": "doUsed",
                "description": "1 = Range rate (Doppler) has been used for this signal"
              },
              {
                "bit_offset": 6,
                "num_bits": 1,
                "name": "prCorrUsed",
                "description": "1 = Pseudorange corrections have been used for this signal"
              },
              {
                "bit_offset": 7,
                "num_bits": 1,
                "name": "crCorrUsed",
                "description": "1 = Carrier range corrections have been used for this signal"
              },
              {
                "bit_offset": 8,
                "num_bits": 1,
                "name": "doCorrUsed",
                "description": "1 = Range rate (Doppler) corrections have been used for this signal"
              }
            ]
          },
          {
            "byte_offset": 12,
            "data_type": {
              "array_of": "U1",
              "count": 4
            },
            "name": "reserved1",
            "reserved": true
          }
        ]
      }
    ]
  }
}
